class Levequest:
    def __init__(self, job, level, exp, name, item, count=1, repeats=0, **kw):
        self.level = level
        self.job = job
        self.exp = exp
        self.name = name
        self.item = item
        self.count = count
        self.repeats = repeats
        self.allowances = kw.get("allowances", 1)
        self.preferred = kw.get("preferred", True)

    def __str__(self):
        return f"{self.count * (self.repeats + 1)}x {self.item} for {self.name} ({self.job} Lv{self.level})"


